import{ Row, Col } from 'reactstrap';

class NotificationTableRow extends React.Component {
  render(){
    return(
      <Row className="notification-table">
      <p> {this.props.data.id}</p>
      </Row>
    );
  }
}

export default NotificationTableRow;
